import org.junit.Test;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;

public class P438_找到字符串中所有字母异位词 {
    public List<Integer> findAnagrams(String s, String p) {
        HashMap<Character, Integer> needs = new HashMap<>();
        HashMap<Character, Integer> windows = new HashMap<>();
        for (int i = 0; i < p.length(); i++) {
            needs.put(p.charAt(i),
                    needs.getOrDefault(p.charAt(i),0) + 1);
        }

        int left=0;
        int right=0;
        int matches = 0;
        List<Integer> ans = new ArrayList<>();
        while(right < s.length()) {
            char c = s.charAt(right);
            if(needs.containsKey(c)) {
                windows.put(c, windows.getOrDefault(c,0) + 1);
                if(windows.get(c).equals(needs.get(c))) {
                    matches++;
                }
                while(matches == needs.size()) {
                    int length = right - left + 1;
                    if(length == p.length()) {
                        ans.add(left);
                    }
                    char l = s.charAt(left);
                    if(needs.containsKey(l)) {
                        windows.put(l, windows.getOrDefault(l,0) - 1);
                        if(windows.get(l) < needs.get(l)) {
                            matches--;
                        }
                    }
                    left++;
                }
            }
            right++;
        }
        return ans;
    }

    @Test
    public void test() {
        System.out.println(findAnagrams("", ""));
    }
}
